import './App.css';


function ArrayMessage(props){
	const arrayDb =  props.arrayDb
	const lists = arrayDb.map((item)=>{
		if(item.name == 'Bill'){
			<li className='Bill' key={item._id}>{item.name}</li>
		}else{
			<li key={item._id}>{item.name}</li>
		}}
	  )

	return <ul>{lists}</ul>
}

export default ArrayMessage;
